import React, { Component } from 'react';


class Social extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return (
          <div>
            <img src = {require('./Social Icons/facebook.png')} style = {{height: '34px', width: '34', marginRight: '10px', position: 'relative', top: '-5px'}} className='float-right'/>
            <img src = {require('./Social Icons/google-plus.png')} style = {{height: '44px', width: '44', marginRight: '10px', position: 'relative', top: '-5px'}} className='float-right'/>
            <img src = {require('./Social Icons/instagram.png')} style = {{height: '34px', width: '34', marginRight: '10px', position: 'relative', top: '-5px'}} className='float-right'/>
            <img src = {require('./Social Icons/telephone.png')} style = {{height: '34px', width: '34', marginRight: '20px', position: 'relative', top: '-5px'}} className='float-right' />
          </div>
        );
    }
}

export default Social;
